import React, { useState, useEffect } from 'react';
import TrackerComponent from './TrackerComponent';
import { useHistory } from "react-router-dom";
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import Tooltip from '@material-ui/core/Tooltip';
import OpenInNewIcon from '@material-ui/icons/OpenInNew';
import PublicNavbarComponent from '../Components/PublicNavbarComponent';
const axios = require('axios');

function AddTrackPage() {
    const [trackObject, setTrackObject] = useState([]);
    const [areaList, setAreaList] = useState([]);
    const [clientId, setClientID] = useState();

    let history = useHistory();

    useEffect((props) => {
        //alert(JSON.stringify(value));

        const search = window.location.search;
        const params = new URLSearchParams(search);
        const clientUrl = params.get('client');

        setClientID(clientUrl);

        //We call the api
        axios.get(`http://localhost:8011/tracker-areas/areas`, {
            headers: {

            }
        }
        )
            .then(function (response) {
                setAreaList(response.data);


            })
            .catch(function (error) {
                // handle error

            })
            .finally(function () {
                // always executed
            });

    }, []);


    const handleChangeUserObject = (e) => {
        setTrackObject(
            { ...trackObject, [e.target.name]: e.target.value }
        )
    }
    return (
        <>
              <div class='container'>
               <PublicNavbarComponent />
                <nav class="breadcrumb" aria-label="breadcrumbs">
                    <ul>
                        <li><a href="/">Home</a></li>
                        <li><a href="/client_tracker">Client Tracker</a></li>
                        <li class="is-active"><a href="">Add Tracker</a></li>
                    </ul>
                </nav>
                <div id='main_index'>
                    <h2>Add Client Tracker</h2>

                </div>
                <div class="card">
                    <div class="card-content">
                        <div class='columns'>

                            <div class='column'>
                                <div class="field">
                                    <label class="label">Client ID</label>
                                    <div class="control is-primary">
                                        <input class="input is-primary" name="client_id" id="client_id" value={clientId} type="text" maxLength='50' required readOnly />
                                    </div>
                                </div>
                            </div>

                            <div class='column'>
                                <div class="field">
                                    <label class="label">Area</label>
                                    <div class="select is-primary">
                                    <select>
                                        {
                                            areaList.map(function(item){
                                                return(
                                                    <option value={item.id}>{item.title}</option>
                                                  )
                                            })
                                        }
                                        <input class="input" name="area" id="area" type="text" maxLength='50'/>
                                    </select>
                                    </div>
                                </div>
                            </div>
                            <div class='column'>
                                <div class="field">
                                    <label class="label">Date</label>
                                    <div class="control">
                                        <input class="input" name="dateAction" id="dateAction" type="date" />

                                    </div>
                                </div>
                            </div>
                            </div>
                        <div class='columns'>
                            <div class='column'>
                                <div class="field">
                                    <label class="label">Name</label>
                                    <div class="control">
                                        <input class="input" name="name" id="name" type="text" maxLength='50'/>
                                    </div>
                                </div>
                            </div>

                            <div class='column'>
                                <div class="field">
                                    <label class="label">Role</label>
                                    <div class="control">
                                        <input class="input" name="role" id="role"  type="text" maxLength='50' />
                                    </div>
                                </div>
                            </div>

                            <div class='column'>
                                <div class="field">
                                    <label class="label">Comment</label>
                                    <div class="control">
                                        <input class="input" name="comment" id="comment"  type="text" maxLength='50' />
                                    </div>
                                </div>
                            </div>
                        </div>

                        <div class='columns is-centered'>
                        <center>
                            <div class='column'>

                                <div class="field is-grouped">

                                    <div class="control">                        
                                        <button class="button is-text" onClick={() => history.goBack()}><Tooltip title="back"><ArrowBackIcon /></Tooltip></button>
                                    </div>
                                    <div class="control">
                                        <button class="button is-primary" >Submit</button>
                                    </div>

                                </div>

                            </div>
                            </center>
                        </div>

                    </div>


                    </div>
            </div>
        </>
    );
}

export default AddTrackPage;
